import type { CanvasKit, SkFont, SkPaint } from "canvaskit-oc";
import { isCkCanvas } from "./canvas";
import { toSkFont, toSkPaint } from "../skia-element-mapping";
import {
  CkElement,
  CkElementContainer,
  CkElementCreator,
  CkElementProps,
  CkObjectTyping,
  Paint,
} from "../skia-element-types";

export interface CGImageProps extends CkElementProps<never> {
  paint?: Paint;
}

class CGImage implements CkElement<"cg-image"> {
  readonly canvasKit: CanvasKit;
  readonly props: CkObjectTyping["cg-image"]["props"];
  readonly skObjectType: CkObjectTyping["cg-image"]["name"] = "Image";
  readonly type: "cg-image" = "cg-image";

  private readonly defaultPaint: SkPaint;

  private renderPaint?: SkPaint;
  deleted = false;

  constructor(
    canvasKit: CanvasKit,
    props: CkObjectTyping["cg-image"]["props"]
  ) {
    this.canvasKit = canvasKit;
    this.props = props;

    this.defaultPaint = new this.canvasKit.SkPaint();
    this.defaultPaint.setStyle(this.canvasKit.PaintStyle.Fill);
    this.defaultPaint.setAntiAlias(true);
  }

  render(parent?: CkElementContainer<any>): void {
    if (this.deleted) {
      throw new Error("BUG. Rect element deleted.");
    }

    if (parent && isCkCanvas(parent)) {
      // TODO we can be smart and only recreate the paint object if the paint props have changed.
      this.renderPaint?.delete();
      const dummyImageBase64 =
        "";

      const arrbuff = Uint8Array.from(atob(dummyImageBase64), (c) =>
        c.charCodeAt(0)
      );

      this.renderPaint = toSkPaint(this.canvasKit, this.props.paint);
      // load image here
      const skImage = this.canvasKit.MakeImageFromEncoded(arrbuff);
      console.log("skImage", skImage);
      parent.skObject?.drawImage(skImage, 100, 100, this.defaultPaint);
    }
  }

  delete() {
    if (this.deleted) {
      return;
    }
    this.deleted = true;
    this.defaultPaint.delete();
    this.renderPaint?.delete();
  }
}

export const createCgImage: CkElementCreator<"cg-image"> = (
  type,
  props,
  canvasKit
) => new CGImage(canvasKit, props);
